🥤Mocha Frappe - 5/5, very aromatic from the scent of the coffee, subtle taste of chocolate", 'time': 1650654146, 'translated': False}, {'author_name': 'Jessie Lim', 'author_url': 'https://www.google.com/maps/contrib/116685229605825992812/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocJ2l6AGIj7gjqbQ9q-_a9gQaP04TlBd3CqNLEshg05b=s128-c0x00000000-cc-rp-mo', 'rating': 2, 'relative_time_description': '5 months ago', 'text': 'I went to Gigi Coffee at SS15 during lunch hour. It was crowded with customers and all delivery guys were waiting there during this peak hour with only two front staffs serving at the counter. The shop is so hot as if both aircond also spoiled. Half of the customers prefer to stand at outside of the shop to wait for their orders to be served. I placed my order of Cold Caffe Mocha (RM10) in the menu but the staff charged me RM13, claiming that their menu yet to change new pricing but system wise the price already increased. Feel being cheated as I googled the menu in website afterwards and found out that the price published in website still remain RM10. Gigi Coffee, I am a fans of you all this while but please improve on your service if you intend to keep your customers.', 'time': 1685600037, 'translated': False}, {'author_name': 'jerry clarence', 'author_url': 'https://www.google.com/maps/contrib/100582528772441416958/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocIFFdRGz9l9BHRcyZcEth968IeNkX3lpoJnDq4678q1=s128-c0x00000000-cc-rp-mo', 'rating': 1, 'relative_time_description': '2 months ago', 'text': 'I went in to just get a coffee on ice with nothing in it and the guy charges me 12myr for and I asked for no sugar and he put sugar in it. I was not only the only one in line but the only one in the cafe. I had to throw it away as I am diabetic and can’t drink it. Waste or money and time.', 'time': 1693372877, 'tra